import React from 'react'
import SelectInput from '../../components/ui/SelectInput'
import TextInput from '../../components/ui/TextInput'
import useFormContext from '../../Hooks/useFormContext'

const PersonalInfo = () => {
  const { userData, handleChange, stepTitle, step } = useFormContext()

  const genderOptions = [
    "Cis male", "Cis female", "Trans male", "Trans woman", "Non-binary", "Other"
  ]
  const raceOptions = [
    "White", "Black or African American", "Native American (American Indian)", "Asian", ""
  ]

  return (
    <div>
      <h1>{stepTitle[step]}</h1>
      <TextInput
        labelText="Country of Origin"
        fieldName="countryOfOrigin"
        fieldValue={userData.countryOfOrigin}
        handleChange={handleChange}
      />
      <TextInput
        labelText="Gender"
        fieldName="gender"
        fieldValue={userData.major}
        handleChange={handleChange}
      />
      <SelectInput
        labelText="Gender"
        fieldName="gender"
        fieldValue={userData.gender}
        handleChange={handleChange}
        options={genderOptions}
      />
      <SelectInput
        labelText="Race"
        fieldName="race"
        fieldValue={userData.race}
        handleChange={handleChange}
        options={raceOptions}
      />
    </div>
  )
}

export default PersonalInfo
